import logo from "../img/logo2.png";
import sun from "../img/weather-icons/sun.png";
import "../App.css";
import { Link } from "react-router-dom";

function Layout() {
  let exampleCity = (tab=[])=>{
    for(let i=0; i<tab.lenght; i++){
    return (
      <div className="App-panel2">
        <h3>tab[i]</h3>
        <div className="App-degree">
          <p>25&deg;C</p>
        </div>
        <div>
          <img src={sun} alt="sun" className="App-icon" />
        </div>
      </div>
    );
    }
  };
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <nav>
          <ul type="none" className="App-menu">
            <li>
              <Link to="/" className="App-nav-element">
                Home
              </Link>
            </li>
            <li>
              <a href="#search" className="App-nav-element">
                Check Weather
              </a>
            </li>
            <li>
              <Link to="/contact" className="App-nav-element">
                Contact
              </Link>
            </li>
          </ul>
        </nav>
      </header>

      <section>
        <div id="searchPanel">
          <div className="App-panel">
            <h2>Search the wather</h2>
            <form method="GET">
              <input type="text" name="city" id="city" placeholder="city" />
              <input type="submit" value="Search" />
            </form>
          </div>
        </div>
        <div id="exampleCity">
          
          {}
        </div>
      </section>

      <footer></footer>
    </div>
  );
}

export default Layout;
